DROP TABLE IF EXISTS vehicle_class_codes CASCADE;
DROP TABLE IF EXISTS brands CASCADE;
DROP TABLE IF EXISTS models CASCADE;
DROP TABLE IF EXISTS vehicles CASCADE;


CREATE TABLE "vehicles" (
                            "id" BIGSERIAL PRIMARY KEY,
                            "grnz" text NOT NULL,
                            "grnz_country_code" text NOT NULL,
                            "vehicle_uuid" uuid UNIQUE NOT NULL,
                            "brand_id" integer,
                            "model_id" integer,
                            "vehicle_class_code" integer,
                            "active" boolean,
                            "created_at" timestamp DEFAULT (now())
);

CREATE TABLE "brands" (
                          "id" SERIAL PRIMARY KEY,
                          "name" text UNIQUE
);

CREATE TABLE "models" (
                          "id" SERIAL PRIMARY KEY,
                          "name" text UNIQUE
);

CREATE TABLE "vehicle_class_codes" (
                                       "id" SERIAL PRIMARY KEY,
                                       "code" integer UNIQUE
);

ALTER TABLE "vehicles" ADD FOREIGN KEY ("brand_id") REFERENCES "brands" ("id");

ALTER TABLE "vehicles" ADD FOREIGN KEY ("model_id") REFERENCES "models" ("id");

ALTER TABLE "vehicles" ADD FOREIGN KEY ("vehicle_class_code") REFERENCES "vehicle_class_codes" ("id");

COMMENT ON COLUMN "vehicles"."grnz" IS 'Гос номер';

COMMENT ON COLUMN "vehicles"."grnz_country_code" IS 'Код региона';

COMMENT ON COLUMN "vehicles"."vehicle_uuid" IS 'Уникальный uuid ТС';

COMMENT ON COLUMN "vehicles"."brand_id" IS 'Id бренда';

COMMENT ON COLUMN "vehicles"."model_id" IS 'Id модели';

COMMENT ON COLUMN "vehicles"."vehicle_class_code" IS 'Код класса ТС';

COMMENT ON COLUMN "vehicles"."active" IS 'Статус ТС';

COMMENT ON COLUMN "brands"."name" IS 'Название бренда';

COMMENT ON COLUMN "models"."name" IS 'Название модели';

COMMENT ON COLUMN "vehicle_class_codes"."code" IS 'Код класса ТС';

